import React, { Component } from 'react';
import './App.css';

class App extends Component {
  constructor(props) {
    super(props);
    this.state = {
      buttons: {
        equals: "=",
        zero: "0",
        one: "1",
        two: "2",
        three: "3",
        four: "4",
        five: "5",
        six: "6",
        seven: "7",
        eight: "8",
        nine: "9"
      }
    }

    this.state.buttons = this.state.buttons.bind(this);
  }

  render() {
    return (
      <div className="App">
        {this.state.buttons.map(item => (
          <p>{item}</p>
        ))}
      </div>
    );
  }
}

export default App;
